We can apply the CYK algorithm.  First note which non‐terminals generate each single terminal in the string t13 t11 t35 t63 t49 t90:

 position 1 “t13” → {NT26}  
 position 2 “t11” → {NT5}  
 position 3 “t35” → {NT38}  
 position 4 “t63” → {NT52}  
 position 5 “t49” → {NT60}  
 position 6 “t90” → {NT71}  

When we try to build up length‐2 spans, we look for rules X→YZ where Y is the nonterminal at the left position and Z at the right.  The pairs we get are

  (NT26,NT5), (NT5,NT38), (NT38,NT52), (NT52,NT60), (NT60,NT71)

but there is no binary rule in the grammar whose right‐hand side matches any of these pairs.  Hence no non‐terminals cover any span of length ≥2, so the start symbol S cannot cover the full string of length 6.  Therefore the grammar does not generate the string.

No
